(1865, 479, 2, '<p>Hi [firstName] [lastName] {This is German},</p>\n\n<p>Du hast ein neues Passwort f&uuml;r Deinen Skillinhos Account angefordert. Dein neues Passwort ist: &quot;[password]&quot;, Du kannst es ab sofort mit Deinen Nutzerdaten (Username /&nbsp; Emailadresse).<br />\nBitte erstelle ein neues Passwort sobald Du Dich erfolgreich eingeloggt hast.</p>\n\n<p>Keep on kicking!</p>\n\n<p>Dein Skillinhos Team<br />\n#trainiere&uuml;berall #trainierejederzeit #Skillinhos</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n'),
