(1869, 480, 1, '<p>Hi [firstName] [lastName],</p>\n\n<p>Congratulations! You can now benefit from our promotion special. Convert your Profi Coach voucher right now, just log in your Skillinhos App an provide the voucher data within the Your Coaching section.</p>\n\n<p><strong>Your personal Voucher Code: [code]&nbsp; </strong><br />\n<strong>Your Advantage:&nbsp; [discountPercent]</strong>%</p>\n\n<p>Keep on kicking!</p>\n\n<p>Your Skillinhos Team<br />\n#traineverywhere #trainanytime #Skillinhos</p>\n'),
(1870, 480, 2, '<p>Hi [firstName] [lastName],</p>\n\n<p>Herzlichen Gl&uuml;ckwunsch! Du kannst jetzt von unserer Promo-Aktion profitieren. L&ouml;se jetzt sofort Deinen Profi Coach Gutschein ein, einfach in der Skillinhos App einloggen und Gutschein im Bereich Dein Coaching einl&ouml;sen.</p>\n\n<p><strong>Dein pers&ouml;nlicher Gutschein-Code: [code]&nbsp; </strong><br />\n<strong>Dein Vorteil:&nbsp; [discountPercent]</strong>%</p>\n\n<p>Keep on kicking!</p>\n\n<p>Dein Skillinhos Team<br />\n#trainiere&uuml;berall #trainierejederzeit #Skillinhos</p>\n'),
(1871, 481, 1, '<p>Hi [firstName] [lastName],</p>\n\n<p>Thank you for your registration. From now you can use every free minute - no matter where you are and how old you are - to become a better kicker. Welcome to the Skillinhos Community!</p>\n\n<p>Keep on kicking!</p>\n\n<p>Your Skillinhos Team<br />\n#trainieverywhere #trainanytime #Skillinhos</p>\n\n<p>&nbsp;</p>\n'),
