(1940, 515, 2, '<p>Alle Trainingsinhalte und Trainingsformen von Skillinhos basieren auf wissentschaftlichen Grundlagen und der langj&auml;hrigen Erfahrung von Trainern im ambitionierten Fu&szlig;ballball-Jugend- und Herrenbereich. Auf diese Art und Weise wollen wir Dich bestm&ouml;glich unterst&uuml;tzen, damit Du mit jeder Einheit, mit jedem Tag besser wirst. Das Training mit der Skillinhos App kann unter Umst&auml;nden sehr intensiv sein - trotz allem Ehrgeiz ist nichts wichtiger als Deine Gesundheit. Bitte kontaktiere Deinen Arzt bevor Du mit dem Training beginnst.</p>\n\n<p>Grunds&auml;tzlich solltest Du Dich immer ausreichend aufw&auml;rmen bevor Du mit Deinem Skillinhos Programm startest, damit Du kleinere Verletzungen vermeidest.</p>\n'),
