(2947, 816, 1, '<meta http-equiv="Content-Type" content="text/html; charset=UTF-8" />\n<title></title>\n<style type="text/css">#outlook a{padding:0;} /* Force Outlook to provide a "view in browser" message */\n			.ReadMsgBody{width:100%;} .ExternalClass{width:100%;} /* Force Hotmail to display emails at full width */\n			.ExternalClass, .ExternalClass p, .ExternalClass span, .ExternalClass font, .ExternalClass td, .ExternalClass div {line-height: 100%;} /* Force Hotmail to display normal line spacing */\n			body, table, td, p, a, li, blockquote{-webkit-text-size-adjust:100%; -ms-text-size-adjust:100%;} /* Prevent WebKit and Windows mobile changing default text sizes */\n			table, td{mso-table-lspace:0pt; mso-table-rspace:0pt;} /* Remove spacing between tables in Outlook 2007 and up */\n			img{-ms-interpolation-mode:bicubic;} /* Allow smoother rendering of resized image in Internet Explorer */\n\n			body{margin:0; padding:0;}\n			img{border:0; height:auto; line-height:100%; outline:none; text-decoration:none;}\n			table{border-collapse:collapse !important;}\n			body, #bodyTable, #bodyCell{height:100% !important; margin:0; padding:0; width:100% !important;}\n			#bodyCell{padding:20px;}\n			#templateContainer{width:740px;}\n\n			/* ========== Page Styles ========== */\n			body, #bodyTable{\n				/*@editable*/ background-color:#DEE0E2;\n			}\n\n			#templateContainer{\n				/*@editable border:1px solid #BBBBBB;*/\n			}\n\n			h1{\n				 color:#202020 !important;\n				 display:block;\n				 font-family:Helvetica;\n				 font-size:26px;\n				 font-style:normal;\n			     font-weight:bold;\n				 line-height:100%;\n				 letter-spacing:normal;\n				 margin-right:0;\n				 margin-bottom:30px 0 10px;\n				 margin-left:0;\n				 text-align:left;\n			}\n			h2{\n				 color:#333333 !important;\n				display:block;\n				 font-family:Helvetica;\n				 font-size:18px;\n				 font-style:normal;\n				 font-weight:bold;\n				 line-height:100%;\n				 letter-spacing:normal;\n				margin-top:0;\n				margin-right:0;\n				margin-bottom:10px;\n				margin-left:0;\n				 text-align:left;\n			}\n			h3{\n				 color:#333333 !important;\n				display:block;\n				 font-family:Helvetica;\n				 font-size:18px;\n				 font-weight:normal;\n				line-height:25px;\n				letter-spacing:normal;\n				margin-right:0;\n				margin-bottom:20px;\n				margin-left:0;\n				margin-top:40px;\n				 text-align:left;\n			}\n			h4{\n				 color:#808080 !important;\n				display:block;\n				 font-family:Helvetica;\n				 font-size:14px;\n				 font-style:italic;\n				font-weight:normal;\n				line-height:100%;\n			 letter-spacing:normal;\n				margin-top:0;\n				margin-right:0;\n				margin-bottom:10px;\n				margin-left:0;\n				 text-align:left;\n			}\n\n			#templatePreheader{\n				 background-color:#F4F4F4;\n				 border-bottom:1px solid #CCCCCC;\n			}\n\n			.preheaderContent{\n				 color:#808080;\n				 font-family:Helvetica;\n				 font-size:10px;\n				 line-height:125%;\n				/ text-align:left;\n			}\n			.preheaderContent a:link, .preheaderContent a:visited, /* Yahoo! Mail Override */ .preheaderContent a .yshortcuts /* Yahoo! Mail Override */{\n				 color:#606060;\n				 font-weight:normal;\n				 text-decoration:underline;\n			}\n			#templateHeader{\n				 background-color:#F4F4F4;\n				 border-bottom:1px solid #CCCCCC;\n			}\n			.headerContent{\n				 color:#505050;\n				 font-family:Helvetica;\n				 font-size:20px;\n				 font-weight:bold;\n				 line-height:100%;\n				 padding-top:0;\n				 padding-right:0;\n				 padding-bottom:0;\n				 padding-left:0;\n				 text-align:left;\n				 vertical-align:middle;\n			}\n			.headerContent a:link, .headerContent a:visited, /* Yahoo! Mail Override */ .headerContent a .yshortcuts /* Yahoo! Mail Override */{\n				 color:#EB4102;\n				 font-weight:normal;\n				 text-decoration:underline;\n			}\n\n			#headerImage{\n				height:auto;\n				max-width:600px;\n			}\n			#templateBody{\n				 background-color:#F4F4F4;\n				 border-top:1px solid #FFFFFF;\n			}\n			.bodyContent{\n				 color:#505050;\n				 font-family:Helvetica;\n				 font-size:14px;\n				 line-height:150%;\n				padding-top:20px;\n				padding-right:20px;\n				padding-bottom:20px;\n				padding-left:20px;\n				 text-align:left;\n			}\n			.bodyContent a:link, .bodyContent a:visited, /* Yahoo! Mail Override */ .bodyContent a .yshortcuts /* Yahoo! Mail Override */{\n				 color:#EB4102;\n				 font-weight:normal;\n				 text-decoration:underline;\n			}\n\n			.bodyContent img{\n				display:inline;\n				height:auto;\n				max-width:560px;\n			}\n			#templateFooter{\n				 background-color:#e8e8e8;\n			}\n\n			.footerContent{\n				 color:#808080;\n				 font-family:Helvetica;\n				 font-size:10px;\n				 line-height:150%;\n				padding-top:20px;\n				padding-right:20px;\n				padding-bottom:20px;\n				padding-left:20px;\n				text-align:left;\n			}\n			.footerContent a:link, .footerContent a:visited, /* Yahoo! Mail Override */ .footerContent a .yshortcuts, .footerContent a span /* Yahoo! Mail Override */{\n				 color:#606060;\n				 font-weight:normal;\n				 text-decoration:underline;\n			}\n			 @media only screen and (max-width: 767px){\n			\n				body, table, td, p, a, li, blockquote{-webkit-text-size-adjust:none !important;} /* Prevent Webkit platforms from changing default text sizes */\n                body{width:100% !important; min-width:100% !important;} /* Prevent iOS Mail from adding padding to the body */\n				#bodyCell{padding:10px !important;}\n				.top-info {text-align: center; padding-bottom:10px;}\n				.logo {width: 50%;}\n				.top-navigation {width: 93%;}\n				#templateContainer{\n					max-width:600px !important;\n					width:100% !important;\n				}\n				h1{\n					font-size:24px !important;\n				}\n				h2{\n				    font-size:20px !important;\n				}\n				h3{\n				    font-size:18px !important;\n					line-height:25px;\n				}\n				h4{\n			       font-size:16px !important;\n				}\n				#templatePreheader{display:none !important;} /* Hide the template preheader to save space */\n				#headerImage{\n					height:auto !important;\n					/*@editable*/ max-width:600px !important;\n					/*@editable*/ width:100% !important;\n				}\n				.headerContent{\n					/*@editable*/ font-size:20px !important;\n				}\n				#bodyImage{\n					height:auto !important;\n					/*@editable*/ max-width:560px !important;\n					/*@editable*/ width:100% !important;\n				}\n				.bodyContent{\n					/*@editable*/ font-size:18px !important;\n				}\n				.footerContent{\n					/*@editable*/ font-size:14px !important;\n				}\n\n				.footerContent a{display:block !important;} /* Place footer social and utility links on their own lines, for easier access */\n			}</style>\n<center>\n<table align="center" border="0" cellpadding="0" cellspacing="0" height="100%" id="bodyTable" style="background:#333333; max-width:963px;" width="100%">\n	<tbody>\n		<tr>\n			<td>\n			<table border="0" cellpadding="0" cellspacing="0" class="top-navigation" style="background:#333333; margin:0 auto; margin-top:10px;" width="77%">\n				<tbody>\n					<tr style="text-align:right;">\n						<td class="top-info" style="color:#858585; font-family:Helvetica; font-size:13px;">Klicke <strong style="border-bottom:1px solid;">hier</strong> wenn die E-Mail nicht korrekt dargestellt wird.</td></tr>\n						<tr>\n							<td class="logo" style="float:left;"><img src="[ASSET_URL]emailTemplate/logo.png" /></td>\n							<td class="appstore" style="float:right; margin-top:15px;"><a blank="" href="''. $applink[''ITUNES_STORE_BUTTON_LINK''].'' target="><img src="[ASSET_URL]emailTemplate/sticky_appstore.png" /></a></td></tr></tbody></table></td></tr>\n							<tr>\n								<td align="center" id="bodyCell" valign="top"><!-- BEGIN TEMPLATE // -->\n								<table border="0" cellpadding="0" cellspacing="0" id="templateContainer">\n									<tbody>\n										<tr>\n											<td align="center" valign="top"><!-- BEGIN HEADER // -->\n											<table border="0" cellpadding="0" cellspacing="0" id="templateHeader" width="100%">\n												<tbody>\n					